import { peopleData } from "../../data/peopleData";

const UseStateArrayExample = () => {
  let [people, setPeople] = React.useState(peopleData);
  return (
    <>
      {people.map((p) => {
        return <h1>p</h1>;
      })}
    </>
  );
};

export default UseStateArrayExample;
